# base64decode & gzipdecompress
# 导入 base64 和 gzip 模块，用于处理 Base64 编码和 GZip 压缩
import base64
import gzip

# 定义一个变量，存储 Base64 编码的字符串
base64String = ""

# base64String = ""

# 使用 base64.b64decode 函数，将 Base64 编码的字符串转换成一个字节对象
bytes = base64.b64decode(base64String)

# 使用 gzip.decompress 函数，将字节对象解压缩成一个字节对象，即 PowerShell 代码的二进制表示
code_bytes = gzip.decompress(bytes)

# 使用 decode 方法，将字节对象转换成一个字符串，即 PowerShell 代码的文本表示
code = code_bytes.decode()

# 输出 PowerShell 代码
print(code)
